import * as actionTypes from './actionTypes';

export const  sideDrawer= (sideDrawerState) => {
    return {
        type: actionTypes.SIDE_DRAWER_CONTROL,
        sideDrawerState:  sideDrawerState
    };
};

export const sideDrawerAction = (sideDrawerState) => {
    return dispatch => {
        dispatch(sideDrawer(sideDrawerState));
    };
};
